        customSQL:
          customSQL: |-
            {{ stage('Override Create SQL') }}
            	CREATE OR REPLACE VIEW {{ ref('SILVER', 'FUND_XREF')}} AS (

             select distinct                                                                                                           
                  bf.FUNDID as identityVal                                                     
                 ,bf.FundId AS FUND_ID
                 , bf.fundtypeid as FUND_TYPE_ID
                 , bf.applicationid as APPLICATION_ID
                 , bf.applicationuserid as APPLICATION_USER_ID
                 , ifnull(aacsF.Fund_Id, aaimF.Fund_Id) as aadbId                                                                                   
                 , CAST(IFNULL(x.Cambridge_Id, 'NULL') AS VARCHAR) AS FUND_CAID   
                 , CAST(x.Product_Cambridge_Id AS VARCHAR) AS PRODUCT_CAID                                       
                 , bf.FundName as longName                                                  
                 , bp.ProductName as productName                                            
                 , ft.FundTypeName as fundType                                              
                 , c.CurrencyIsoCode as isoCurr3                                            
                 , case                                                                     
                     when imisF.FEECODE is not null then 'IMIS'                                  
                     when aacsF.FUND_ID is not null then 'AACS'                                  
                     when aaimF.fund_id is not null then 'AAIM'                                  
                     else 'UNKNOWN'                                                         
                   end as legacySystem                                                      
                 , case bf.ActiveStatusId                                                   
                     when 1 then 'Active'                                                   
                     when 2 then 'Inactive'                                                 
                     else 'Unknown'                                                         
                   end as activeStatus                                                      
                 , case                                                                     
                     when imisAC.ASSETCLASSCODE is not null then concat('Imis-', imisAC.ASSETCLASSCODE)                           
                     when aacsAC.Asset_Class_Id is not null then concat('Aadb-', aacsAC.Asset_Class_Id)                           
                     when aaimAC.Asset_Class_Id is not null then concat('Aadb-', aaimAC.Asset_Class_Id)                           
                     else null                                                              
                   end as assetClassId 
                 , case                                                                     
                     when imisAC.ASSETCLASSCODE is not null then imisAC.ASSETCLASSCODE                          
                     when aacsAC.Asset_Class_Id is not null then aacsAC.Asset_Class_Id                           
                     when aaimAC.Asset_Class_Id is not null then aaimAC.Asset_Class_Id                           
                     else null                                                              
                   end as Consolidated_assetClassId
                 , case                                                                     
                     when imisP.FIRMKEY is not null then imisP.FIRMKEY                           
                     when aacsf.FIRM_ID is not null then aacsf.FIRM_ID                          
                     when aaimf.FIRM_ID is not null then aaimf.FIRM_ID                          
                     else null                                                              
                   end as Consolidated_FIRM_ID
                 , imisP.AssetClassCode as imisAssetClassId                                 
                 , aacsF.Asset_Class_Id as aacsAssetClassId                                   
                 , aaimF.Asset_Class_Code as aaimAssetClassCode 
                 , aaimF.AAIM_Fundraising_Status_Date_Last_Modified as FUNDRAISING_STATUS_DATE_LAST_MODIFIED
                 , aaimF.AAIM_Fundraising_Status_ID as FUNDRAISING_STATUS_ID
                 , aaimF.DATE_ADDED as DATE_ADDED
                 , aaimF.GP_Clawback_Liability_ID as GP_CLAWBACK_LIABILITY_ID
                 , aaimF.LP_Distribution_Requirement_ID as LP_DISTRIBUTION_REQUIREMENT_ID
                 , aaimF.OverrideDueDiligence as OVERRIDE_DUE_DILIGENCE
                 , iff(fofp.Product_Id is null, 0, 1) as isFundOfFunds                       
                 , ifnull(aacsF.IncludeInAnalysis, aaimF.IncludeInAnalysis) as includeInAnalysis  
                , case                                                                                              
                     when aacsf.Focus_Id is not null then aacsf.Focus_ID                          
                     when aaimf.Focus_ID is not null then aaimf.Focus_ID                          
                     else null 
                    end as CONSOLIDATED_FOCUS_ID
                 , aacsF.Focus_Id as aadbFocusId                                             
                 , aacsF.Fund_Stage_Id as aadbStageId                                         
                 , focus.FocusGuid as focusId                                        
                 , stage.StageGuid as stageId                                        
                 , region.RegionGuid as regionId                                     
                 , iff(aaimF.FoiaExcluded is null, null, 'N') as foiaExcluded               
                 , ag.Asset_Name as assetGroupName                                           
                 , rgrp.Region_Group_Id as regionGroupId                                      
                 , rgrp.Region_Group_SName as regionGroupShortName                            
                 , rgrp.Region_Group_LName as regionGroupLongName                             
                 , wrgrp.World_Region_Group_Id as worldRegionGroupId                           
                 , wrgrp.World_Region_Group_SName as worldRegionGroupShortName                 
                 , wrgrp.World_Region_Group_LName as worldRegionGroupLongName                  
                 , wg.WorldRegionMasterGuid as worldGeographyId                      
                 , wg.World_Geography_SName as worldGeographyShortName                        
                 , wg.World_Geography_LName as worldGeographyLongName                         
                 , aaimF.NonInstitutionalQuality as nonInstitutionalQuality                 
                 , aaimF.SequenceNumber as sequenceNumber                                   
                 , aaimF.SequenceNumberUnknown as sequenceNumberUnknown                     
                 , aaimF.SoleFund as soleFund                                               
                 , fa.FundApprovals as fundApprovals                                        
                 , risk.Risk_Id as aadbRiskProfileId                                         
                 , ifnull(imisP.ProductInceptionDate, aacsF.Inception_Date) as inceptionDate 
                 , imisF.CrsmCode as crsmCode                                                                                      
                 , imisF.FeeCode as imisId                                                  
                 , vsl.VehicleStatus as vehicleStatus                                       
                 , imisF.FeeDescription as feeDescription                                   
                 , imisF.FeeUpdateDate as feeUpdateDate    	 
                 , imisF.AssetVsPerformance as assetVsPerformance                           
