                 , aacsAC.Asset_Class_SName as ASSET_CLASS_SNAME
                 , ag.asset_name as ASSET_NAME
                 , erpStaff.LegacyStaffId as LEGACY_STAFF_ID
                 , pv.VehicleTypeCode as VEHICLE_TYPE_CODE
                 , pv.VehicleStatusCode as VEHICLE_STATUS_CODE
                 , aacsF.AAIM_FUND_ID as AAIM_FUND_ID
